import React from "react";
import Slider from "react-slick";
import './Slider.scss';


export default class SimpleSlider extends React.Component {
  render() {
    var settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1,
      adaptiveHeight:true
    };
    return (
      <Slider {...settings}>
        <div className = "page">
          <div style ={{backgroundImage:'url("/images/city-section/slider-images")'}}>
          </div>
        </div>
        <div className = "page">
          <h3>2</h3>
        </div>
        <div className = "page">
          <h3>3</h3>
        </div>
        <div className = "page">
          <h3>4</h3>
        </div>
        <div className = "page">
          <h3>5</h3>
        </div>
        <div className = "page">
          <h3>6</h3>
        </div>
      </Slider>
    );
  }
}
